@test integrate((a+b*sec(e+f*x)^2)^2*csc(e+f*x), x) == :(-1*f^-1*(a+b)^2*arctanh(cos(e+f*x))+1//3*b^2*f^-1*sec(e+f*x)^3+b*f^-1*(b+2a)*sec(e+f*x))
@test integrate((a+b*sec(e+f*x)^2)^2*csc(e+f*x)^3, x) == :(-1//2*f^-1*(a+b)*(a+5b)*arctanh(cos(e+f*x))+-1//6*f^-1*(3*a^2+5*b^2+6*a*b)*cot(e+f*x)*csc(e+f*x)+1//3*b*f^-1*(5b+6a)*sec(e+f*x)+1//3*b^2*f^-1*csc(e+f*x)^2*sec(e+f*x)^3)
@test integrate((a+b*sec(e+f*x)^2)^2*csc(e+f*x)^5, x) == :(-1//8*f^-1*(3*a^2+35*b^2+30*a*b)*arctanh(cos(e+f*x))+-1//12*f^-1*csc(e+f*x)^3*(3*a^2+7*b^2+6*a*b)*cot(e+f*x)+-1//24*f^-1*(3a+7b)^2*cot(e+f*x)*csc(e+f*x)+1//3*b*f^-1*(6a+7b)*sec(e+f*x)+1//3*b^2*f^-1*csc(e+f*x)^4*sec(e+f*x)^3)
